import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card.js';
import * as serviceWorker from './serviceWorker';
import 'tachyons';
import { kanji } from './kanji.js';

ReactDOM.render(
				<div>
			   		<Card character={kanji[0].character} reading={kanji[0].kunyomi} meaning={kanji[0].meaning} />
			   		<Card character={kanji[1].character} reading={kanji[1].kunyomi} meaning={kanji[1].meaning} />
			   		<Card id={kanji[2].character} reading={kanji[2].kunyomi} meaning={kanji[2].meaning} />
			   		<Card id={kanji[3].character} reading={kanji[3].kunyomi} meaning={kanji[3].meaning} />
			   	</div>
, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
